import React from "react";

class Footer extends React.Component{
    render(){
        return(
            <footer>
                <nav id="botnav">
                    <ul className="botmenu">
                        <span>&copy; Copyright 2020 PSPI</span>
                    </ul>
                </nav>
            </footer>
        )
    }

}

export default Footer;
